import React, { Component } from 'react';
import { View, StyleSheet, Animated, Image, Text } from 'react-native'

export default function Message() {
    return (
        <View style={{
            background: "linear-gradient(#FF9457, #E96114)",
            borderRadius: 12,
            padding: 20,
        }}>
            <View></View>
            
        </View>
    )
}

const styles = StyleSheet.create({
    
    bb: {
        background: "linear-gradient(#FF9457, #E96114)",
        borderRadius: 12,
        padding: 20,
    },
    
    photo: {
        width: 24,
        height: 24,
        radius: 22,
    }

})
